chickenHeight EQU 180

; chickenFilename DB 'chick.bin', 0

; chickenFilehandle DW ?

; chickenData DB chickenWidth*chickenHeight dup(0)

.Code
MAIN PROC FAR
    MOV AX , @DATA
    MOV DS , AX
    
    MOV AH, 0
    MOV AL, 13h
    INT 10h
	
    ; CALL OpenFile
    ; CALL ReadData
	
    LEA BX , cb ; BL contains index at the current drawn pixel
	
    MOV CX,73
    MOV DX,0
    MOV AH,0ch
	
; Drawing loop
drawLoop:
    MOV AL,[BX]
    INT 10h 
    INC CX
    INC BX
    CMP CX,chickenWidth
JNE drawLoop 
	
    MOV CX , 73
    INC DX
    CMP DX , chickenHeight
JNE drawLoop

	
    ; Press any key to exit
    MOV AH , 0
    INT 16h
    
    ; call CloseFile
    
    ;Change to Text MODE
    MOV AH,0          
    MOV AL,03h
    INT 10h 

    ; return control to operating system
    MOV AH , 4ch
    INT 21H
    
MAIN ENDP




